document.getElementById('boton-descargar').addEventListener('click', function() {
    var base64Data = ""; // Aquí coloca el contenido del primer archivo en Base64
    var fileName = "YerlinRojasCV_EN_200.pdf"; // Nombre del primer archivo con extensión
  
    descargarArchivo(base64Data, fileName);
  });
  
  document.getElementById('boton-descargarPL').addEventListener('click', function() {
    var base64Data = " "; // Aquí coloca el contenido del segundo archivo en Base64
    var fileName = "EN_CP_YerlinRojas200.pdf"; // Nombre del segundo archivo con extensión
  
    descargarArchivo(base64Data, fileName);
  });
  
  function descargarArchivo(base64Data, fileName) {
    var blobData = b64toBlob(base64Data);
    var blobUrl = URL.createObjectURL(blobData);
  
    var link = document.createElement('a');
    link.href = blobUrl;
    link.download = fileName;
    link.click();
  
    // Liberar recursos después de la descarga
    setTimeout(function() {
      URL.revokeObjectURL(blobUrl);
    }, 100);
  }
  
  function b64toBlob(base64Data) {
    var byteCharacters = atob(base64Data);
    var byteArrays = [];
  
    for (var offset = 0; offset < byteCharacters.length; offset += 512) {
      var slice = byteCharacters.slice(offset, offset + 512);
  
      var byteNumbers = new Array(slice.length);
      for (var i = 0; i < slice.length; i++) {
        byteNumbers[i] = slice.charCodeAt(i);
      }
  
      var byteArray = new Uint8Array(byteNumbers);
      byteArrays.push(byteArray);
    }
  
    var blob = new Blob(byteArrays, { type: 'application/octet-stream' });
    return blob;
  }